import React,{useState,useEffect} from 'react';
import { useNavigate } from 'react-router-dom';
import { Autocomplete,TextField } from '@mui/material';
import '../css/signup.css';
import axios from 'axios';
const SignUp = () => {
    const [fname,setfname]=useState('');
    const [lname,setlname]=useState('');
    const [telusername,settelusername]=useState('');
    const [phonenumber,setphonenumber]=useState('');
    const [region,setregion]=useState('');
    const [city,setcity]=useState('');
    const [password,setpassword]=useState('');
    const [cp,setcp]=useState(''); 
    const [error,seterror]=useState('')
    const regions = [
        { title: 'Oromia'},
        { title: 'AddisAbaba'},
        { title: 'Amhara'},
        { title: 'Afar' },
        { title: 'Somali' },
        { title: "Sidama" },
        { title: 'BenishangulGumuz'},
        { title: 'Gambella' },
        { title: "SNNP" },
        { title: 'DireDewa'}
    ]
    const nav=useNavigate();
    const api=axios.create({
        baseURL:"http://localhost:5000/custom"
      });
    const handleLogin=(e)=>{
        e.preventDefault();
        console.log("watching")
        console.log(password,cp)
        if(password==cp){
        api.post("/register",{
            fname,lname,telusername,phonenumber,region,city,password,cp
        }).then(res=>{
            seterror("success")
            nav('/home')
        }).catch(err=>{
            console.log(err);
            seterror("some thing went wrong")
        })

        }else{
            seterror("please fill the same password fields ")
        }
    }
    return ( 
        <div className="box">
            <form  onSubmit={handleLogin}>
            <center><img src="https://img.icons8.com/bubbles/100/000000/user.png" alt='User'/></center>
            <h3>Welcome</h3>
            <p className="tip">Let's create your free account now</p>
            <p style={{color:"red",fontWeight:"bold"}}>{error}</p>
            <label>FirstName</label>
            <input type="text" required onChange={(e)=>{
                setfname(e.target.value)
            }} />
            <label>LastName</label>
            <input type="text" required maxLength="20" onChange={(e)=>{
                setlname(e.target.value)
            }}  />
            <label>Telegram Username (optional)</label>
            <input type="text" required maxLength="20" onChange={(e)=>{
                settelusername(e.target.value)
            }} />
            <label>PhoneNumber</label>
            <input type="text" required maxLength="13" onChange={(e)=>{
                setphonenumber(e.target.value)
            }} />
            <select onSelect={(value)=>setregion(value)} name="category" id="cars" style={{
                width:"200px",
                height:"50px"}}>
                {
                regions.map((option) =>
                <option key={option.title} value={option.title}>{option.title}</option>
                )
                }
                
            </select>
            <label>City</label>
            <input type="text" required maxLength="20" onChange={(e)=>{
                setcity(e.target.value)
            }} />
            <label>Password</label>
            <input type="password" required maxLength="20" onChange={(e)=>{
                setpassword(e.target.value)
            }}  />
            <label>confirm Password</label>
            <input type="password" required maxLength="20" onChange={(e)=>{
                setcp(e.target.value)
            }}  />
            <div className="btn">
            <button type="submit">Create account</button>
            </div>
            <hr/>
            <p className="mode">Already user?<a href="/">Login</a></p>
            <p>By processing, you're agree with our <a href="#">Terms and conditions</a> and <a href="#">Privacy policy</a>.</p>
            </form>
        </div>
     );
}
 
export default SignUp;
